import { useEffect,useState } from "react"
import {  useNavigate } from "react-router-dom"

function App(){
 
    const[fet,setFet]=useState([])
    // const navigate=useNavigate()
    useEffect(()=>{
        fetch("http://localhost:3006/learn")
        .then((jos)=>{
           return jos.json()
        })
        .then((das)=>{
            setFet(das)
        }) 

    },[])

  




   return(
    <div className="container">
        <div>
            
                <div className="card-body">

                   <div>
                              {fet.map((one)=>(
                                <ul style={{listStyle:"none"}}>
                                    <img src={one.img} style={{width:"200px",height:"200px"}}></img>
                                    <li><span>Brand :</span>{one.brand} </li>
                                    <li>{one.collection}</li>
                                    <li>{one.model}</li>
                                    <li>{one.reference}</li>
                                    <li>{one.complement}</li>
                                    <li>{one.year}</li>
                                    <li>{one.price}</li>
                                    <button>Add cart</button>
                                    </ul>

                            
                                      
                              ))}
                    </div>    
                </div>
           
        </div>
    </div>
   )
}

export default App;
